import Link from "next/link"
import { NavLink, Flex, useColorMode, jsx} from "theme-ui"
import MoonIcon from "../icons/moon.svg"
import SunIcon from "../icons/sun.svg"

export default (props) => {
  const [colorMode, setColorMode] = useColorMode()
  return (
    <Flex
      as="nav"
      sx={{
        px: 3, // padding-left & padding-right
        // paddingX: 3 will also work
        py: 4, // padding-top & padding-bottom
        mb: 3, // margin-bottom
      }}
    >
      <Link href="/" passHref>
        <NavLink p={2}>Home</NavLink>
      </Link>
      <Link href="/about" passHref>
        <NavLink p={2}>About</NavLink>
      </Link>
      <Link href="/about" passHref>
        <NavLink p={2}>Another Page</NavLink>
      </Link>
      <NavLink
        p={2}
        border={2}
        onClick={(e) => {
          setColorMode(colorMode === "default" ? "dark" : "default")
        }}
        sx={{
          variant: "links.nav.darkswitcher",
        }}
      >
        {colorMode === "default" ? <img src={MoonIcon} /> : <img src={SunIcon} />}
      </NavLink>
    </Flex>
  )
}
